pub enum RecoverPubkeyError {
    InvalidHashFormat,
    InvalidSignatureFormat,
    InvalidRecoveryParam,
    UnknownErr {
            error_code: u32,
        },
}

pub enum StdError {
    VerificationErr {
            source: VerificationError,
        },
    RecoverPubkeyErr {
            source: RecoverPubkeyError,
        },
    GenericErr {
            msg: String,
        },
    InvalidBase64 {
            msg: String,
        },
    InvalidDataSize {
            expected: u64,
            actual: u64,
        },
    InvalidUtf8 {
            msg: String,
        },
    NotFound {
            kind: String,
        },
    ParseErr {
            target_type: String,
            msg: String,
        },
    SerializeErr {
            source_type: String,
            msg: String,
        },
    Overflow {
            source: OverflowError,
        },
    DivideByZero {
            source: DivideByZeroError,
        },
    ConversionOverflow {
            source: ConversionOverflowError,
        },
}

pub enum SystemError {
    InvalidRequest {
            error: String,
            request: Binary,
        },
    InvalidResponse {
            error: String,
            response: Binary,
        },
    NoSuchContract {
            addr: String,
        },
    Unknown {
        },
    UnsupportedRequest {
            kind: String,
        },
}

pub enum VerificationError {
    BatchErr,
    GenericErr,
    InvalidHashFormat,
    InvalidSignatureFormat,
    InvalidPubkeyFormat,
    InvalidRecoveryParam,
    UnknownErr {
            error_code: u32,
        },
}

pub enum IbcMsg {
    Transfer {
            channel_id: String,
            to_address: String,
            amount: Coin,
            timeout: IbcTimeout,
        },
    SendPacket {
            channel_id: String,
            data: Binary,
            timeout: IbcTimeout,
        },
    CloseChannel {
            channel_id: String,
        },
}

pub enum IbcChannelOpenMsg {
    OpenInit {
            channel: IbcChannel,
        },
    OpenTry {
            channel: IbcChannel,
            counterparty_version: String,
        },
}

pub enum IbcChannelConnectMsg {
    OpenAck {
            channel: IbcChannel,
            counterparty_version: String,
        },
    OpenConfirm {
            channel: IbcChannel,
        },
}

pub enum IbcChannelCloseMsg {
    CloseInit {
            channel: IbcChannel,
        },
    CloseConfirm {
            channel: IbcChannel,
        },
}

pub enum BankQuery {
    Balance {
            address: String,
            denom: String,
        },
    AllBalances {
            address: String,
        },
}

pub enum IbcQuery {
    PortId {
        },
    ListChannels {
            port_id: Option<String>,
        },
    Channel {
            channel_id: String,
            port_id: Option<String>,
        },
}

pub enum StakingQuery {
    BondedDenom {
        },
    AllDelegations {
            delegator: String,
        },
    Delegation {
            delegator: String,
            validator: String,
        },
    AllValidators {
        },
    Validator {
            address: String,
        },
}

pub enum WasmQuery {
    Smart {
            contract_addr: String,
            msg: Binary,
        },
    Raw {
            contract_addr: String,
            key: Binary,
        },
    ContractInfo {
            contract_addr: String,
        },
}

pub enum QueryRequest<C> {
    Bank(BankQuery),
    Custom(C),
    Staking(StakingQuery),
    Stargate {
            path: String,
            data: Binary,
        },
    Ibc(IbcQuery),
    Wasm(WasmQuery),
}

pub enum CosmosMsg<T = Empty> {
    Bank(BankMsg),
    Custom(T),
    Staking(StakingMsg),
    Distribution(DistributionMsg),
    Stargate {
            type_url: String,
            value: Binary,
        },
    Ibc(IbcMsg),
    Wasm(WasmMsg),
    Gov(GovMsg),
}

pub enum BankMsg {
    Send {
            to_address: String,
            amount: Vec<Coin>,
        },
    Burn {
            amount: Vec<Coin>,
        },
}

pub enum StakingMsg {
    Delegate {
            validator: String,
            amount: Coin,
        },
    Undelegate {
            validator: String,
            amount: Coin,
        },
    Redelegate {
            src_validator: String,
            dst_validator: String,
            amount: Coin,
        },
}

pub enum DistributionMsg {
    SetWithdrawAddress {
            address: String,
        },
    WithdrawDelegatorReward {
            validator: String,
        },
}

pub enum WasmMsg {
    Execute {
            contract_addr: String,
            msg: Binary,
            funds: Vec<Coin>,
        },
    Instantiate {
            admin: Option<String>,
            code_id: u64,
            msg: Binary,
            funds: Vec<Coin>,
            label: String,
        },
    Migrate {
            contract_addr: String,
            new_code_id: u64,
            msg: Binary,
        },
    UpdateAdmin {
            contract_addr: String,
            admin: String,
        },
    ClearAdmin {
            contract_addr: String,
        },
}

pub enum GovMsg {
    Vote {
            proposal_id: u64,
            vote: VoteOption,
        },
}
